	add("colt", "{\"term\":\"colt\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|colt}}, from Old english (ca. 450-1100) {{m|ang|colt||young donkey, young camel}}, from Proto-germanic {{m|gem-pro|*kultaz||plump; stump; thick shape, bulb}}, from Proto-indo-european {{m|ine-pro|*gelt-||something round, pregnant belly, child in the womb}}, from {{m|ine-pro|*gel-||to ball up, amass}}. Cognate with Norwegian {{m|no|kult||treestump}}, Swedish {{m|sv|kult||young boar, boy, lad}}. Related to {{l|en|child}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A young male horse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A youthful or inexperienced person; a novice\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1594\u0027\u0027, w: William William Shakespeare, \u0027s: The Merchant of The Merchant of Venice\u0027, I. ii. 38\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Ay, that\u0027s a \u0027\u0027colt\u0027\u0027 indeed, for he doth nothing but / talk of his horse, and he makes it a great appropriation to / his own good parts that he can shoe him himself\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A short piece of rope once used by petty officers as an instrument of punishment\", \"priority\":5}]}, \"synonyms\":{}}");

