	add("coldness", "{\"term\":\"coldness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cold|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The relative lack of heat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The sensation resulting from exposure to low temperatures\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Limited enthusiasm or affection; coolness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Reciprocal-temperature\u0027 in natural units (e.g. in nats of state-uncertainty per electron Volt of thermal energy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, W. A. Day and Morton E. Gurtin, \u0027Archive for Rational Mechanics and Analysis\u0027, Volume 33, Issue 1, Springer, pages 26–32\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027coldness\u0027\u0027 is the reciprocal of absolute temperature\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, Ingo Müller, \u0027Archive for Rational Mechanics and Analysis\u0027, Volume 41, Issue 5, Springer, pages 319-332\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"article title) The \u0027\u0027coldness\u0027\u0027, a universal function in thermoelastic bodies\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, Ingo Müller, \u0027Entropy, Absolute Temperature, and Coldness in Thermodynamics: Boundary Conditions in Porous Materials Archive for Rational Mechanics and Analysis\u0027, Springer-Verlag, Wein GMBH, page 3\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"This function will be called the \u0027\u0027coldness\u0027\u0027, its equilibrium value will be the reciprocal of absolute temperature\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, J. Meixner, \u0027Archive for Rational Mechanics and Analysis\u0027, Volume 57, Issue 3, Springer, pages 281-290\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"article title) \u0027\u0027Coldness\u0027\u0027 and Temperature\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Claude Garrod, \u0027Statistical Mechanics and Thermodynamics\u0027, Oxford University Press, page 111\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"amp;alpha; is called the affinity, \u0026amp;beta; the inverse temperature or \u0027\u0027coldness\u0027\u0027, and \u0026amp;gamma; the free expansion coefficient\", \"priority\":14}]}, \"synonyms\":{}}");

