	add("colin", "{\"term\":\"colin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Diminutive of Coll, a medieval short form of Nicholas. It has also been used to anglicize Irish \u0027Coilean\u0027 and Scots Gaelic \u0027Cailean\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"plural\u0027 \u0027\u0027Colins\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"VI:x:16\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That iolly shepheard, which there piped, was / Poore \u0027\u0027Colin\u0027\u0027 Clout (who knowes not \u0027\u0027Colin\u0027\u0027 Clout\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027 Howard B. Means, \u0027Colin Powell\u0027, Donald J. Fine (1992), ISBN 1556113358, page 49\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;My parents,\u0026quot; Powell wrote, \u0026quot;were British subjects, and they named me \u0027\u0027Colin\u0027\u0027 (KAH-lin). Being British, they knew very well how the name was supposed to be pronounced. But when I was a young boy, there was a famous American World War II hero whose name became very popular in the streets of New York City. He was Capt. \u0027\u0027Colin\u0027\u0027 P. Kelly Jr. He was called KOH-lin. My friends in the streets of the South Bronx, who heard Captain Kelly\u0027s name pronounced in the radio and by their parents and other adults, began to refer to me by the same pronunciation\", \"priority\":5}]}, \"synonyms\":{}}");

