	add("collation", "{\"term\":\"collation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027collation\u0027 from Latin \u0027collationem\u0027 from the participle stem of \u0027conferre\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Bringing together\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of bringing things together and comparing them; comparison\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of collating pages or sheets of a book, or from printing etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A collection, a gathering\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Will Dean, \u0027The Guardian\u0027, 29 Apr 2010\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s fantastic, as is so much of Forgiveness Rock Record, a \u0027\u0027collation\u0027\u0027 of so many talents that it\u0027s practically bursting at the seams\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Discussion, light meal\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A conference or consultation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027Collationes Patrum in Scetica Eremo Commorantium\u0027 by , an important ecclesiastical work. (Now usually with capital initial\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1563\u0027\u0027, John Foxe, \u0027Acts and Monuments\u0027, vol. 2, p. 55\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A certain abbot, named Moses, thus testifieth of himself in the \u0027\u0027Collations\u0027\u0027 of Cassianus, that he so afflicted himself with much fasting and watching, that sometimes, for two or three days together, not only he felt no appetite to eat, but also had no remembrance of any meat at all\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A reading held from the work mentioned above, as a regular service in Benedictine monasteries\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1843\u0027\u0027, TD Fosbroke, \u0027British Monachism\u0027, p. 52\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"When the hymn was over the Sacrist was to strike the table for \u0027\u0027collation\u0027\u0027, and the Deacon to enter with the Gospel, preceded by three converts, carrying the candlestick and censer\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The light meal taken by monks after the reading service mentioned above\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Any light meal or snack\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Tim Hayward, \u0027The Guardian\u0027, 13 May 08\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Yes, absolutely; supper, at least in English tradition, was a cold \u0027\u0027collation\u0027\u0027, left out by cook before retiring\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The presentation of a clergyman to a benefice by a bishop, who has it in his own gift\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The blending together of property so as to achieve equal division, mainly in the case of inheritance\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Synonymous: hotchpot\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"An heir\u0027s right to combine the whole heritable and movable estates of the deceased into one mass, sharing it equally with others who are of the same degree of kindred\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The act of conferring or bestowing\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Not by the \u0027\u0027collation\u0027\u0027 of the king but by the people\", \"priority\":25}]}, \"synonyms\":{}}");

	add("colleague", "{\"term\":\"colleague\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027collegue\u0027 from Latin \u0027collega\u0027 (lang\u003dla) from \u0027com-\u0027 (with) + \u0027legare|lang\u003dla\u0027 () from \u0027lex\u0027 (law)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fellow member of a profession, staff, academic faculty or other organization; an associate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/international/science-and-technology/21580133-how-microbes-promote-liver-cancer-overweight-punch-gut A punch in the passage\u003dMostly, the microbiome is beneficial.Research over the past few years, however, has implicated it in diseases from atherosclerosis to asthma to autism. Dr Yoshimoto and his \u0027\u0027colleagues\u0027\u0027 would like to add liver cancer to that list\", \"priority\":2}]}, \"synonyms\":{}}");

