	add("collecting", "{\"term\":\"collecting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|collect|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hobby including seeking, locating, acquiring, organizing, cataloging, displaying, storing, and maintaining whatever items are of interest to the individual collector\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Melissa A Hardy, ‎Alan Bryman, \u0027Handbook of Data Analysis\u0027 (page 568\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The task of data gathering is not a random walk, a sensual search, or the bemused \u0027\u0027collectings\u0027\u0027 of a beachcomber\", \"priority\":3}]}, \"synonyms\":{}}");

	add("collection", "{\"term\":\"collection\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fro|collection|lang\u003den}}, from Latin \u0027collēctiō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of items or amount of material procured or gathered together\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Secondly, I continue to base my concepts on intensive study of a limited suite of \u0027\u0027collections\u0027\u0027, rather than superficial study of every packet that comes to hand\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Collections\u0027\u0027 of moisture\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Dungliso\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A purulent \u0027\u0027collection\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Multiple related objects associated as a group\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dOf all the queer \u0027\u0027collections\u0027\u0027 of humans outside of a crazy asylum, it seemed to me this sanitarium was the cup winner. […] When you\u0027re well enough off so\u0027s you don\u0027t have to fret about anything but your heft or your diseases you begin to get queer, I suppose\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The activity of collecting\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A set of sets\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A gathering of money for charitable or other purposes, as by passing a contribution box for donations\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The act of inferring or concluding from premises or observed facts; also, that which is inferred\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"We may safely say thus, that wrong \u0027\u0027collections\u0027\u0027 have been hitherto made out of those words by modern divines\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The jurisdiction of a collector of excise\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A set of college exams generally taken at the start of the term\", \"priority\":14}]}, \"synonyms\":{}}");

	add("collectiveness", "{\"term\":\"collectiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|collective|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being collective\", \"priority\":1}]}, \"synonyms\":{}}");

	add("collectivism", "{\"term\":\"collectivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|collective|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An economic system in which the means of production and distribution are owned and controlled by the people collectively\", \"priority\":1}]}, \"synonyms\":{}}");

	add("college", "{\"term\":\"college\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027college\u0027 from Latin \u0027collegium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A corporate group; a group of colleagues\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A group sharing common purposes or goals\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"College\u0027\u0027 of Cardinals\u0027, \u0027\u0027\u0027College\u0027\u0027 of Surgeons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An electoral college\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An academic institution\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A specialized division of a university\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"College\u0027\u0027 of Engineering\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An institution of higher education teaching undergraduates\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Attendance at an institution of higher education\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"These should be his \u0027\u0027college\u0027\u0027 years, but he joined the Army\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A postsecondary institution that offers vocational training and/or associate\u0027s degrees\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A non-specialized, semi-autonomous division of a university, with its own faculty, departments, library, etc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Pembroke \u0027\u0027College\u0027\u0027, Cambridge\u0027; \u0027Balliol \u0027\u0027College\u0027\u0027, Oxford\u0027; \u0027University \u0027\u0027College\u0027\u0027, London\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"An institution of further education at an intermediate level; sixth form\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"An institution for adult education at a basic or intermediate level (teaching those of any age\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A high school or secondary school\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Eton \u0027\u0027College\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A private (non-government) primary primary or high school\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A residential hall associated with a university, possibly having its own tutors\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A bilingual school\", \"priority\":20}]}, \"synonyms\":{}}");

	add("collegiality", "{\"term\":\"collegiality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|collegial|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"power and authority that is shared among peers, especially the sharing of collegiate power among Roman Catholic bishops\", \"priority\":1}]}, \"synonyms\":{}}");

	add("collenchyma", "{\"term\":\"collenchyma\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027κολλα\u0027 (glue) + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supporting ground tissue just under the surface of various leaf structures formed before vascular differentiation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("collie", "{\"term\":\"collie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Perhaps originally from \u0027coal\u0027, with reference to its colour.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various breeds of dog originating in Scotland and England as sheepdogs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("collier", "{\"term\":\"collier\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) colier, from \u0027col\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:SS \u0027Wandle\u0027 (1932) on maiden thumb|The w:SS Wandle S.S. \u0027Wandle\u0027, a British collier, arriving on her maiden voyage at the w:Pool of Pool of London in London, England, U\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person in the business or occupation of producing (digging or mining coal or making charcoal) or in its transporting or commerce\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1957\u0027\u0027, H.R. Schubert, \u0027History of the British Iron and Steel Industry\u0027, p. 224\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For this reason, the collier took constant care to keep the covering of earth in good order\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A vessel carrying a bulk cargo of coa\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A nickname used by the traveller community, referring to a non-traveller\", \"priority\":6}]}, \"synonyms\":{}}");

	add("colliery", "{\"term\":\"colliery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|collier|y|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An underground coal mine, together with its surface buildings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A facility that supplies coal\", \"priority\":2}]}, \"synonyms\":{}}");

	add("collimation", "{\"term\":\"collimation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of collimating or something collimate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"aligning lenses along line of sight to minimize aberrations\", \"priority\":2}]}, \"synonyms\":{}}");

	add("collimator", "{\"term\":\"collimator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An optical device that generates a parallel beam of light. Often used to compensate for laser beam divergence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A similar device that produces a parallel beam of particles such as neutrons\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A small telescope attached to a larger one, used to point it in the correct general direction\", \"priority\":3}]}, \"synonyms\":{}}");

	add("collin", "{\"term\":\"collin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027κόλλα\u0027 (glue)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very pure form of gelatin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("colliness", "{\"term\":\"colliness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being colly\", \"priority\":1}]}, \"synonyms\":{}}");

	add("collinsite", "{\"term\":\"collinsite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Collins|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A triclinic-pinacoidal mineral containing calcium, hydrogen, iron, magnesium, oxygen, and phosphorus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("collision", "{\"term\":\"collision\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027collision\u0027 from \u0027\u0027 from Latin \u0027collidere\u0027 past participle \u0027collisus\u0027 () see collide.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instance of colliding\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027\u0027 Chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At the very moment he cried out, David realised that what he had run into was only the Christmas tree. Disgusted with himself at such cowardice, he spat a needle from his mouth, stepped back from the tree and listened. There were no sounds of any movement upstairs: no shouts, no sleepy grumbles, only a gentle tinkle from the decorations as the tree had recovered from the \u0027\u0027collision\", \"priority\":3}]}, \"synonyms\":{}}");

	add("collocation", "{\"term\":\"collocation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"1605. From Latin {{m|la|collocātiōnem}} \u0026lt; {{m|la|collocāre}}. Compare French \u0027collocation\u0027 The technical sense in linguistics was established 1951, although it may have been used this way earlier.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The grouping or juxtaposition of things, especially words or sounds\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1869\u0027\u0027, Friedrich Max Müller, \u0027Lectures on the Science of Language delivered at the Royal Institution of Great Britain in April, May, and June, 1861\u0027, 2nd ed, Scribner, p 288\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Everything in fact depends in Chinese on the proper \u0027\u0027collocation\u0027\u0027 of words in a sentence. Thus \u0027ngò tà ni\u0027 means “I beat thee;” but \u0027ni tà ngò\u0027 would mean “Thou beatest me\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Such a specific grouping\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1880\u0027\u0027, William Dwight Whitney, Richard Morris, \u0027Language and its study, with especial reference to the Indo-European family\u0027, 2nd ed, Trübner \u0026amp; Co., p 56\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"We said at first \u0027breāk fâst\u0027—“I broke fast at such an hour this morning:” he, or they, who first ventured to say \u0027I breakfasted\u0027 were guilty of as heinous a violation of grammatical rule as he would be who should now declare \u0027I takedinnered\u0027, instead of \u0027I took dinner;\u0027 but good usage came over to their side and ratified the blunder, because the community were minded to give a specific name to their earliest meal and to the act of partaking of it, and therefore converted the \u0027\u0027collocation\u0027\u0027 \u0027breākfâst\u0027 into the real compound \u0027brĕakfast\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A sequence of words or terms that co-occur more often than would be expected by chance (i.e., the statistically significant placement of particular words in a language\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, Otto Jespersen, \u0027Negation in English and Other Languages,\u0027 Copenhagen: A.F. Høst, p 39\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Little\u0027 and \u0027few\u0027 are also incomplete negatives; note the frequent \u0027\u0027collocation\u0027\u0027 with \u0027no:\u0027 there is \u0027little or no\u0027 danger\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1938\u0027\u0027, H.E. Palmer, \u0027A Grammar of English Words\u0027, Longmans, Green\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"subtitle] One thousand English words and their pronunciation, together with information concerning the several meanings of each word, its inflections and derivatives, and the \u0027\u0027collocations\u0027\u0027 and phrases into which it enters\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1951\u0027\u0027, John Rupert Firth, \u0027Papers in linguistics, 1934–1951\u0027, Oxford University Press, p 194\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"I propose to bring forward as a technical term, meaning by ‘\u0027\u0027collocation\u0027\u0027’, and to apply the test of ‘collocability’\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, John Rupert Firth, Frank Robert Palmer, \u0027Selected Papers of J.R. Firth, 1952–1959\u0027, Longmans, p 181\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Collocations\u0027\u0027 of a given word are statements of the habitual or customary places of that word in a collocational order but not in any other contextual order and emphatically not in grammatical orde\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Paul Kussmaul, \u0027Training the Translator\u0027, Benjamins Translation Library, p. 17\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The problem here was the translation of \u0026quot;period\u0026quot; by German \u0026quot;Periode\u0026quot;. In describing the symptoms we may say that in connection with \u0026quot;Schlaf\u0026quot; the German word \u0026quot;Phase\u0026quot; would have been a better \u0027\u0027collocation\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Sabine Bartsch, \u0027Structural and Functional Properties of Collocations in English: A Corpus Study of Lexical and Pragmatic Constraints on Lexical Co-Occurrence\u0027, Gunter Narr Verlag, p 30\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"It is not entirely clear who was the first linguist to use the term \u0027\u0027collocation\u0027\u0027 in the sense of a recurrent, relatively fixed word combination. Among the first linguists to base a theory of meaning on the notion of “meaning by \u0027\u0027collocation\u0027\u0027” is J.R. Firth (1957) who is commonly credited with systematically introducing the concept of collocation into linguistic theory\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Tony McEnery, Richard Xiao, Yukio Tono, \u0027Corpus-Based Language Studies: An Advanced Resource Book\u0027, Taylor \u0026amp; Francis\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"p 56] The term \u0027\u0027\u0027collocation\u0027\u0027\u0027 refers to the characteristic co-occurrence patterns of words, i.e., which words typically co-occur in corpus data (see Units A10.2 and C1). Collocates can be lexical words or grammatical words. \u0027\u0027Collocations\u0027\u0027 are identified using a statistical approach. Three statistical formulae are most commonly used in corpus linguistics to identify significant \u0027\u0027collocations\u0027\u0027: the M1 (mutual information), \u0027t\u0027 and \u0027z\u0027 scores\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"p 159] In lexical studies \u0027\u0027collocation\u0027\u0027 and semantic prosody/preference can only be quantified reliably on the basis of corpus data\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A method of determining coefficients in an expansion \u0026lt;math\u0026gt;y(x) \u003d y_{0}(x) + sum_{l\u003d0}^{q} alpha_{l} y_{l}(x)\u0026lt;/math\u0026gt; so as to nullify the values of an ordinary differential equation \u0026lt;math\u0026gt;L[y(x)]\u003d0\u0026lt;/math\u0026gt; at prescribed points\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A service allowing multiple customers to locate network, server and storage gear, connect them to a variety of telecommunications and network service providers, with a minimum of cost and complexity\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0026quot;Tyler Durden\u0026quot;, Zero Hedge, \u0027[http://www.zerohedge.com/article/watch-bernankes-qa-fomc-approved-sycophants-live-here Watch Bernanke\u0027s Q\u0026amp;A With FOMC Approved Sycophants Live Here\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"As usual, nothing of significance will be asked, and most certainly, answered, but do expect the dollar (and, inversely, ES) to go up, then down, then up, and so forth as random vacuum tubes blow in NYSE\u0027s ultramodern Mahwah \u0027\u0027collocation\u0027\u0027 facility\", \"priority\":26}]}, \"synonyms\":{}}");

	add("colloquialism", "{\"term\":\"colloquialism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|colloquial|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A colloquial word or phrase; a common spoken expression, often regional\", \"priority\":1}]}, \"synonyms\":{}}");

	add("colloquialness", "{\"term\":\"colloquialness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being colloquial\", \"priority\":1}]}, \"synonyms\":{}}");

	add("colloquy", "{\"term\":\"colloquy\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027colloquium\u0027 (conversation) \u0026lt;ref\u0026gt;{{R:American Heritage 2000}}\u0026lt;/ref\u0026gt; from \u0027com-\u0027 (together, with) (English \u0027com-\u0027 + form of \u0027loquor\u0027 (speak) (from which English \u0027locution\u0027 and other words).\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A conversation or dialogue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Henry James, \u0027What Maisie Knew\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And she repeated the free caress into which her \u0027\u0027colloquies\u0027\u0027 with Maisie almost always broke and which made the child feel that \u0027her\u0027 affection at least was a gage of safety\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"were everywhere to be seen in earnest \u0027\u0027colloquy\u0027\u0027. For the matter was, that there was some sort of night-prowler about the school grounds\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A formal conference\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A church court held by certain Reformed denominations\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A written discourse\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A discussion during a trial in which a judge ensures that the defendant understands what is taking place in the trial and what their rights are\", \"priority\":8}]}, \"synonyms\":{}}");

	add("collusion", "{\"term\":\"collusion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Dated from the 14th Century {{C.E.}}; from Old french (842-ca. 1400) \u0027{{l|fro|collusion}}\u0027, from Latin \u0027sc\u003dpolytonic|collusionem\u0027 (act of {{l) lang\u003dla}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A secret agreement for an illegal purpose; conspiracy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d26|page\u003d18|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/jun/02/hypocrisy-lies-at-heart-bradley-manning-trial Hypocrisy lies at heart of Manning passage\u003dThe dispatches [\u0026amp;hellip;] also exposed the blatant discrepancy between the west\u0027s professed values and actual foreign policies. Having lectured the Arab world about democracy for years, its \u0027\u0027collusion\u0027\u0027 in suppressing freedom was undeniable as protesters were met by weaponry and tear gas made in the west, employed by a military trained by westerners\", \"priority\":2}]}, \"synonyms\":{}}");

	add("collyrium", "{\"term\":\"collyrium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|collȳrium}}, from Ancient greek (to 1453) \u0027κολλύριον\u0027 (poultice)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lotion or liquid wash used as a cleanser for the eyes; an eye-salve\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.2.6.ii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Democritus\u0027 \u0027\u0027collyrium\u0027\u0027 is not so sovereign to the eyes as this is to the heart\u0026amp;nbsp;[…\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Loosely, any product applied to or around the eyes; kohl\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1919,\u0027\u0027 , \u0027\u0027, Duckworth, hardback edition, page 4\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"there were rings of \u0027\u0027collyrium\u0027\u0027 about her eyes\", \"priority\":6}]}, \"synonyms\":{}}");

	add("collywobbles", "{\"term\":\"collywobbles\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"Attested 1823, presumably from \u0027colic\u0027 + \u0027wobble\u0027 \u0026lt;ref name\u003d\u0026quot;martin\u0026quot;\u0026gt;{{R:Phrase Finder|97050|The collywobbles}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;[http://www.etymonline.com/index.php?allowed_in_frame\u003d0\u0026amp;search\u003dcollywobbles\u0026amp;searchmode\u003dnone Etymonline]\u0026lt;/ref\u0026gt;\u0026lt;br\u0026gt;Alternative theories are that it derives from \u0027colly\u0027 (coal dust) via the putative sense “ill from breathing coal dust,”\u0026lt;ref name\u003d\u0026quot;martin\u0026quot; /\u0026gt; or that it is a corruption of \u0027cholera\u0027 \u0026lt;ref\u0026gt;{{R:Merriam Webster Online}}\u0026lt;/ref\u0026gt; The first attestation (a mention, not a usage) is in the 1823 edition of \u0027A Classical Dictionary of the Vulgar Tongue\u0027.\u0026lt;ref name\u003d\u0026quot;martin\u0026quot; /\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Stomachache\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1823\u0027\u0027, Pierce Egan (editor), \u0027w:Francis Grose’s Dictionary of the Vulgar Tongue\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Collywobbles\u0027\u0027, the gripes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027 [1894 September 10], w:Robert Louis Robert Louis Stevenson, \u0027s:Vailima Letters/Chapter Vailima Letters\u0027, Chapter XLIII, To \u0027My Dear Colvin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I know I have something else to say to you, but unfortunately I awoke this morning with \u0027\u0027collywobbles\u0027\u0027, and had to take a small dose of laudanum with the usual consequences of dry throat, intoxicated legs, partial madness and total imbecility; and for the life of me I cannot remember what it is\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, w:William Somerset William Somerset Maugham, \u0027s:Liza of Lambeth/Chapter Liza of Lambeth\u0027, Chapter 3\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I deeply regret,\u0027 answered Liza, \u0027but my royal \u0027ighness \u0027as got the \u0027\u0027collywobbles\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"w:James James Joyce, \u0027s:A Portrait of the Artist as a Young Man/Chapter A Portrait of the Artist as a Young Man\u0027, Chapter 1, serialised in \u0027w:The Egoist The Egoist\u0027 between 1914-15\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The prefect was there again and it was his voice that was saying that he was to get up, that Father Minister had said he was to get up and dress and go to the infirmary. And while he was dressing himself as quickly as he could the prefect said\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"— We must pack off to Brother Michael because we have the \u0027\u0027collywobbles\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, w:Henry Handel Henry Handel Richardson, \u0027s:Australia Felix/Part III/Chapter Australia Felix\u0027, Part III, Chapter V\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"quot;D\u0027ye hear, Richard? Now\u0027s your chance,\u0026quot; repeated Ned, not to be done. \u0026quot;A very different thing this, I can tell you, from running round dosing people for the \u0027\u0027collywobbles\u0027\u0027. I know men who are raising the splosh any way they can to get in.\u0026quot\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Anxiety, fear\", \"priority\":13}]}, \"synonyms\":{}}");

	add("colón", "{\"term\":\"colón\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish after Christopher Colombus, or \u0027Cristóbal Colón\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The currency of Costa Rica, divided into 100 céntimos\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The former currency of El Salvador, divided into 100 centavos (cents), now replaced by the American dollar\", \"priority\":2}]}, \"synonyms\":{}}");

	add("color", "{\"term\":\"color\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027color\u0027 {{m|enm|colour}}, from Anglo-norman \u0027colur\u0027 from Old french (842-ca. 1400) \u0027colour\u0027 \u0027color\u0027 from Latin \u0027color\u0027 from Old latin {{m|itc-ola|colos||covering}}, from Proto-indo-european {{m|ine-pro|*ḱel-||to cover, conceal}}. Akin to Latin {{m|la|cēlō||I hide, conceal}}, Old English {{m|ang|helan}} {{gloss|\u0026quot;to conceal, cover, hide\u0026quot;; see {{l|en|hele}}}}. Displaced Old english (ca. 450-1100) \u0027færbu\u0027 (color) and Middle english (1100-1500) \u0027blee\u0027 (color) from Old English {{m|ang|blēo}}. More at {{l|en|blee}}. Also partially replaced Old english (ca. 450-1100) \u0027hīw\u0027 (color) and its descendants, which is less often used in this sense. Compare Dutch {{m|nl|kleur||color}}, Danish {{m|da|kulør||color}}, Swedish {{m|sv|kulör||color}}.In the US, the spelling \u0027color\u0027 is used to match the spelling of the word\u0027s Latin etymon{{,}} and to make all derivatives consistent (\u0027colorimeter\u0027, \u0027colorize\u0027, \u0027colorless\u0027, etc). Elsewhere in the English-speaking world, the spelling \u0027colour\u0027 has been retained.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The spectral composition of visible ligh\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Humans and birds can perceive \u0027\u0027color\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A particular set of visible spectral compositions, perceived or named as a class\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Most languages have names for the \u0027\u0027colors\u0027\u0027 black, white, red, and green\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Hue as opposed to achromatic colors (black, white and grays\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He referred to the white flag as one \u0026quot;drained of all \u0027\u0027color\u0027\u0027\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Human skin tone, especially as an indicator of race or ethnicity\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Color\u0027\u0027 has been a sensitive issue in many societies\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Interest, especially in a selective area\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"a bit of local \u0027\u0027color\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Any of the standard dark tinctures used in a coat of arms, including azure, gules, sable, and vert. Contrast with metal\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A standard or banner\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The loss of their \u0027\u0027colors\u0027\u0027 destroyed the regiment\u0027s morale\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The flag of a nation or team\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027colors\u0027\u0027 were raised over the new territory\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Gang insignia\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Both of the perpetrators were wearing \u0027\u0027colors\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The system of color television\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"This film is broadcast in \u0027\u0027color\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An award for sporting achievement, particularly within a school or university\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"He was awarded \u0027\u0027colors\u0027\u0027 for his football\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The morning ceremony of raising the flag\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"In corporate finance, details on sales, profit margins, or other financial figures, especially while reviewing quarterly results when an officer of a company is speaking to investment analysts\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Could you give me some \u0027\u0027color\u0027\u0027 with regards to which products made up the mix of revenue for this quarter\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"A property of quarks, with three values called red, green, and blue, which they can exchange by passing gluons\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"The relative lightness or darkness of a mass of written or printed text on a page\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"Any of the colored balls excluding the reds\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"A front or facade: an ostensible truth actually false\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"An appearance of right or authority\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"Under \u0027\u0027color\u0027\u0027 of law, he managed to bilk taxpayers of millions of dollars\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"Skin color noted as: normal, jaundice, cyanotic, flush, mottled, pale, or ashen as part of the skin signs assessment\", \"priority\":31}]}, \"synonyms\":{}}");

	add("colocalization", "{\"term\":\"colocalization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|colocalize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of colocalizing, occurring within the same cell or cellular region\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Lukas K. Tamm, \u0027Protein-Lipid Interactions: From Membrane Domains to Cellular Networks\u0027 [http://books.google.com/books?id\u003dog5QM8Jc-LUC], ISBN 3527311513, page 327\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If such events take place, then the \u0027\u0027colocalization\u0027\u0027 of two molecules may not necessarily mean mutual binding to each other and may simply suggest recruitment to the same site\", \"priority\":3}]}, \"synonyms\":{}}");

