	add("colonists", "{\"term\":\"colonists\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1948\u0027\u0027, w:Carey McWilliams Carey McWilliams, \u0027North from Mexico / The Spanish-Speaking People of The United States\u0027, J. B. Lippincott Company, page 25\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"While De Anza was exploring the Bay of San Francisco, seeking a site for the presidio, the American \u0027\u0027colonists\u0027\u0027 on the eastern seaboard, three thousand miles away, were celebrating the signing of the Declaration of Independence\", \"priority\":2}]}, \"synonyms\":{}}");

