	add("colophon", "{\"term\":\"colophon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"from Ancient greek (to 1453) \u0027κολοφών\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In manuscripts (typically before the invention of printing), the note, usually at the end, left by the scribe who copied it, giving information on his exemplar, where and when the copy was made, and sometimes, his own name\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A printer\u0027s or publisher\u0027s identifying inscription or logo appearing at the end of a book, or the same appearing on the spine or dust-jacket. It generally contains factual information about the book, especially about its production, and includes details about typographic style, the fonts used, the paper used, and perhaps the binding method of the book\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A page on a website identifying the details of its creation, such as the author\u0027s name and the technologies used\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A finishing stroke or crowning touch.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1635\u0027\u0027, John Swan, \u0027Speculum Mundi\u0027, page 42\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He comes to the creation of man, and makes him the \u0027\u0027Colophon\u0027\u0027, or conclusion of all things else\", \"priority\":6}]}, \"synonyms\":{}}");

