	add("colorado", "{\"term\":\"colorado\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"After the Colorado River, from Spanish {{m|es|colorado||colored, red, reddish}}, because of the reddish-brown color of its water.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In the USA\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A Capital and largest city: Denver\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A ghost town in Californi\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An unincorporated community in Texa\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In Brazil\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In the Dominican Republic\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A village in the Dominican Republic\", \"priority\":7}]}, \"synonyms\":{}}");

	add("coloration", "{\"term\":\"coloration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027coloration\u0027 from Latin \u0027colōrātio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or art of coloring\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The quality of being colored\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A notational devise for indicating hemiola through either use of red ink (in mensural black notation) or black noteheads (in mensural white notation); o\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Ornamental division (also called passaggi, glosas, diminutions. etc.) employing rapid \u0026quot;black notes\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("coloratura", "{\"term\":\"coloratura\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian Italian|coloratura\u0027, from Latin|coloratura\u0027, from \u0027colorare\u0027 \u0026quot;to colour\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Florid or fancy passages in vocal music\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Video Librarian\u0027, volume 19, page 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The singing is generally excellent, with Simon Keenlyside standing out for his richly vocalized (and amusingly dour) Papageno and Diana Damrau for her spot-on \u0027\u0027coloratura\u0027\u0027 and genuine venom as the Queen of the Night\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a singer of such passages, especially a sopran\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Anthony Burgess, \u0027Earthly Powers\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The middle one, of course, was the \u0027\u0027coloratura\u0027\u0027 Julia Kristeva, known as the most voluptuous Salome in the business\", \"priority\":6}]}, \"synonyms\":{}}");

