	add("colorisation", "{\"term\":\"colorisation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"colorise + -ation\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of converting to color\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995,\u0027\u0027 Frank Harding, \u0027Milk Quality\u0027 [http://books.google.com/books?ie\u003dUTF-8\u0026amp;hl\u003den\u0026amp;id\u003dPWmQTKDWPz0C\u0026amp;pg\u003dPA116\u0026amp;lpg\u003dPA116\u0026amp;sig\u003dBvZKvNvaIAXfQ3lfUpZWxQkRxj4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When milk is kept at a high temperature for a long period of time chemical reactions take place and the resultant reaction products give rise to brown \u0027\u0027colorisation\u0027\u0027 of milk and a caramel-like flavour\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998,\u0027\u0027 Catherine Westbrook and Carolyn Kaut, \u0027MRI in Practice\u0027 [http://print.google.com/print?id\u003dim0ndwXIe24C\u0026amp;pg\u003dPA298\u0026amp;lpg\u003dPA298\u0026amp;sig\u003dE8AhW_MhImdgXcNP3HjAJTQ0lLc\u0026amp;pli\u003d1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Despite these design and safety implications, the potential of interventional MR in the future is astouding and includes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"liver imaging and tumour ablation with \u0027\u0027colorisation\u0027\u0027 imaging capabilities\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2001,\u0027\u0027 Patrick Robertson, \u0027Film Facts\u0027 [http://books.google.com/books?ie\u003dUTF-8\u0026amp;hl\u003den\u0026amp;id\u003d4PnEvNC_F9oC\u0026amp;pg\u003dPA168\u0026amp;lpg\u003dPA168\u0026amp;sig\u003dmu8dvRv_igiOEcqrLi1NZvSHn60\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The special prints with their computer-applied colour were released by MGM on 4 July 1985. ‘\u0027\u0027Colorisation\u0027\u0027,’ as it is known, has become a controversial issue in the industry\", \"priority\":8}]}, \"synonyms\":{}}");

	add("colorist", "{\"term\":\"colorist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|colour|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who colors; an artist with a talent for colorin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A hairdresser who is a specialist in colouring and tinting hair\", \"priority\":2}]}, \"synonyms\":{}}");

