	add("colossians", "{\"term\":\"colossians\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The twelfth book of the New Testament of the Bible, an epistle to the people of Colossae which is attributed to w:Paul the Paul the Apostle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("colossus", "{\"term\":\"colossus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027colossus\u0027 from Ancient greek (to 1453) \u0027κολοσσός\u0027 (large statue, especially the colossus of rhodes)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A statue of gigantic size. The name was especially applied to certain famous statues in antiquity, as the Colossus of Nero in Rome and the Colossus of Rhodes, one of the Seven Wonders of the Ancient World\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any creature or thing of gigantic size\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1951\u0027\u0027, \u0027w:Foundation Foundation\u0027 (1974 w:Panther Panther Books Ltd publication), part V: “The Merchant Princes”, chapter 18, pages 186–187\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"“]The Empire has always been a realm of colossal resources. They’ve calculated everything in planets, in stellar systems, in whole sectors of the Galaxy. Their generators are gigantic because they thought in gigantic fashion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"To supply light and heat to a city, they have motors six stories\u0026lt;!-- [sic] --\u0026gt; high — I saw them — where ours could fit into this room. And when I told one of their atomic specialists that a lead container the size of a walnut contained an atomic generator, he almost choked with indignation on the spot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Why, they don’t even understand their own \u0027\u0027colossi\u0027\u0027 any\u0026lt;!-- page break --\u0026gt; longer. The machines work from generation to generation automatically, and the caretakers are a hereditary caste who would be helpless if a single D-tube in all that vast structure burnt out.[”\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 August 11 (5:00pm), \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://www.escapistmagazine.com/profiles/view/Yahtzee%20Croshaw Ben “Yahtzee” Croshaw], “[http://www.escapistmagazine.com/videos/view/zero-punctuation/1924-Shadow-of-the-Colossus Shadow of the Colossus]” reviewed by \u0027[http://www.escapistmagazine.com/videos/view/zero-punctuation Zero Punctuation]\u0026lt;/span\u0026gt;\u0027, 3:27–3:42 and 3:56–4:0\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"What I love about the \u0027\u0027colossi\u0027\u0027 is that they actually \u0027feel colossal\u0027 : they move ponderously around, sending out tremours with each step; their ancient husks richly detailed with dirt and plant life. They really do feel like something that has been sleeping in the ground for so long they’ve almost become part of the landscape, now rudely awoken and sleepily pawing at you, like you’re an unusually aggressive snooze button\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"So \u0027Shadow of the Colossus\u0027 has its gripes: one or two of the \u0027\u0027colossi\u0027\u0027 phone it in a bit, especially the ones that are only about the size of a bull, which is disappointing when held against flying-snakey-speeding-horsey-leapy-stabby wahey, like a big gift box containing five thousand packing peanuts and a Kinder Surprise\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Somebody or something very greatly admired and respected\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/books-and-arts/21604535-real-sir-isaac-newton-was-not-first-king-reason-last Magician’s passage\u003dThe truth is that [Isaac] Newton was very much a product of his time. The \u0027\u0027colossus\u0027\u0027 of science was not the first king of reason, Keynes wrote after reading Newton’s unpublished manuscripts. Instead “he was the last of the magicians”\", \"priority\":11}]}, \"synonyms\":{}}");

	add("colostrum", "{\"term\":\"colostrum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027colostrum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of milk produced by the mammary glands in late pregnancy and the few days after giving birth. Human and bovine colostrum is thick and yellowish. In humans, it has high concentrations of nutrients and antibodies, but it is small in quantity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A mixture of turpentine and egg yolk, formerly used as an emulsion\", \"priority\":2}]}, \"synonyms\":{}}");

	add("colour", "{\"term\":\"colour\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027color\u0027 {{m|enm|colour}}, from Anglo-norman \u0027colur\u0027 from Old french (842-ca. 1400) \u0027colour\u0027 \u0027color\u0027 from Latin \u0027color\u0027 from Old latin {{m|itc-ola|colos||covering}}, from Proto-indo-european {{m|ine-pro|*ḱel-||to cover, conceal}}. Akin to Latin {{m|la|cēlō||I hide, conceal}}, Old English {{m|ang|helan}} {{gloss|\u0026quot;to conceal, cover, hide\u0026quot;; see {{l/en|hele}}}}. Displaced Middle English \u0027blee\u0027 (colour) from Old English {{m|ang|blēo}}. More at blee. Compare Dutch {{m|nl|kleur||color}}, Danish {{m|da|kulør||color}}, Swedish {{m|sv|kulör||color}}.In the US, the spelling \u0027color\u0027 is used to match the spelling of the word\u0027s Latin etymon{{,}} and to make all derivatives consistent (\u0027colorimeter\u0027, \u0027colorize\u0027, \u0027colorless\u0027, etc). Elsewhere in the English-speaking world, the spelling \u0027colour\u0027 has been retained.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The spectral composition of visible light\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A particular set of visible spectral compositions, perceived or named as a class\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dHere, in the transept and choir, where the service was being held, one was conscious every moment of an increasing brightness; \u0027\u0027colours\u0027\u0027 glowing vividly beneath the circular chandeliers, and the rows of small lights on the choristers\u0027 desks flashed and sparkled in front of the boys\u0027 faces, deep linen collars, and red neckbands\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Hue as opposed to achromatic colours (black, white and greys\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Human skin tone, especially as an indicator of race or ethnicity\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Interest, especially in a selective area\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Three chairs of the steamer type, all maimed, comprised the furniture of this roof-garden, with (by way of local \u0027\u0027colour\u0027\u0027) on one of the copings a row of four red clay flower-pots filled with sun-baked dust\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Any of the standard dark tinctures used in a coat of arms, including azure, gules, sable, and vert. Contrast with metal\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A standard or banner\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The system of colour television\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An award for sporting achievement, particularly within a school or university\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In corporate finance, details on sales, profit margins, or other financial figures, especially while reviewing quarterly results when an officer of a company is speaking to investment analysts\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A property of quarks, with three values called red, green, and blue, which they can exchange by passing gluons\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The relative lightness or darkness of a mass of written or printed text on a page\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Any of the coloured balls excluding the reds\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A front or fa\u0026amp;ccedil;ade: an ostensible truth actually false.\u0026lt;!-- --\u0026gt\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"An appearance of right or authority\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Skin colour noted as: normal, jaundice, cyanotic, flush, mottled, pale, or ashen as part of the skin signs assessment\", \"priority\":18}]}, \"synonyms\":{}}");

	add("colposcope", "{\"term\":\"colposcope\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|colpo|t1\u003dwomb, vagina|scope|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a form of endoscope used to examine the tissues of the vagina and cervix\", \"priority\":1}]}, \"synonyms\":{}}");

	add("colter", "{\"term\":\"colter\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"Latin\"], \"text\":\"From Old english (ca. 450-1100) \u0027culter\u0027 from Latin \u0027culter\u0027 (a knife)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A knife or cutter attached to the beam of a plow to cut the sward, in advance of the plowshare and moldboard\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, VI.9\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I lately left a furrow, one or twayne, / Unplough\u0027d, the which my \u0027\u0027coulter\u0027\u0027 hath not cleft […\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1644\u0027\u0027, \u0027Aeropagitica\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"What is it but a servitude like that impos\u0027d by the Philistims, not to be allow\u0027d the sharpning of our own axes and \u0027\u0027coulters\u0027\u0027, but we must repair from all quarters to twenty licencing forges\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The part of a seed drill that makes the furrow for the seed\", \"priority\":6}]}, \"synonyms\":{}}");

	add("coltsfoot", "{\"term\":\"coltsfoot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|colt|foot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An herbaceous plant, species , that grows in Europe and the Middle East\", \"priority\":1}]}, \"synonyms\":{}}");

	add("columbian", "{\"term\":\"columbian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inhabitant of any place called\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a person from the United States of America\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A stamp from the stamps\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A size of type between English and great primer, standardized as 16-point\", \"priority\":4}]}, \"synonyms\":{}}");

	add("columbin", "{\"term\":\"columbin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A white, crystalline, bitter substance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("column", "{\"term\":\"column\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027columne\u0027 () from Latin \u0027columna\u0027 (a column, pillar, post) originally a collateral form of \u0027columen\u0027 contraction \u0027culmen\u0027 (a pillar, top, crown, summit) o-grade form from a Proto-indo-european {{m|ine-pro|*kʷel-||going around}}. Akin to Latin \u0027collis\u0027 (a hill) \u0027celsus\u0027 (high) probably to Ancient greek (to 1453) \u0027κολοφών\u0027 (top, summit)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A solid upright structure designed usually to support a larger structure above it, such as a roof or horizontal beam, but sometimes for decoration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A vertical line of entries in a table, usually read from top to bottom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A body of troops or army vehicles, usually strung out along a road\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A body of text meant to be read line by line, especially in printed material that has multiple adjacent such on a single page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A unit of width, especially of advertisements, in a periodical, equivalent to the width of a usual column of text\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A recurring feature in a periodical, especially an opinion piece, especially by a single author or small rotating group of authors, or on a single theme\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Something having similar vertical form or structure to the things mentioned above, such as a spinal column\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL10504990W The Lonely passage\u003dThe desert storm was riding in its strength; the travellers lay beneath the mastery of the fell simoom. Whirling wreaths and \u0027\u0027columns\u0027\u0027 of burning wind, rushed around and over them\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The gynostemiu\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"chemistry) An object used to separate the different components of a liquid or to purify chemical compounds\", \"priority\":10}]}, \"synonyms\":{}}");

